import "../styles/Header.css"

function Header() {
    return ( 
        <div className="header">
            <h1>Olivia Wissig</h1>
            <div className="social">
                <span>
                  <a href="https://github.com/oliviawissig"><FontAwesomeIcon className="icon" icon={['fab', 'github']} size="s"/></a>
                </span>
                    <span>
                  <a href="https://www.linkedin.com/in/oliviawissig/"><FontAwesomeIcon className="icon" icon={['fab', 'linkedin']}
                                                                                       size="s"/></a>
                </span>
                    <span>
                  <a href="https://www.facebook.com/oliviawissig"><FontAwesomeIcon className="icon"
                                                                                   icon={['fab', 'facebook']} size="s"/></a>
                </span>
            </div>
        </div>
     );
}

export default Header;
